export const getTime=(index)=>{
    switch(index){
      case 1:return "8-10ا" ;
      case 2:return "من الثامنه الى العاشره صباحا" ;
      case 3 :return "من الثانيه الى الرابعه زوالا " ;
      case 4:return "من الرابعه الى السادسه زوالا" ;
      default:return "";
    }
}
